function SPMisc:MenuBuilder()
	I = scriptConfig("", "1");
	II = scriptConfig("                            ["..SPCore:BundleNameArma().."]         v"..SPCore:version(), "2");
	Param = scriptConfig("  > "..myHero.charName.." Config", "Param");
	Drawing = scriptConfig("  > Draws", "Draw");
	Uti = scriptConfig("  > Utility", "Utility");
	Pred = scriptConfig("  > Prediction", "Prediction");
	Orb = scriptConfig("  > Orbwalker", "Orbwalker");
	Miscellaneous = scriptConfig("  > Miscellaneous", "EloSpikesMisc");
	III = scriptConfig("", "3");

	Param:addSubMenu("Combo Settings", "Combo");
	Param:addSubMenu("Harass Settings", "Harass");
	Param:addSubMenu("", "n0");
	Param:addSubMenu("KillSteal Settings", "KillSteal");
	Param:addSubMenu("", "n1");
	Param:addSubMenu("LaneClear Settings", "WaveClear");
	Param:addSubMenu("LaneClear Settings (Against Champion)", "WaveClear2");
	Param:addSubMenu("JungleClear Settings", "JungleClear");
	Param:addSubMenu("LastHit Settings", "LastHit");
	Param:addSubMenu("", "n2");
	Param:addSubMenu("Callback Settings", "Callback");
		Param.Callback:addSubMenu("OnDash", "OnDash");
			Param.Callback.OnDash:addParam("Enable", "Enable OnDash Callback :", SCRIPT_PARAM_ONOFF, true);
		Param.Callback:addSubMenu("Interruptable", "Interruptable");
			Param.Callback.Interruptable:addParam("Enable", "Enable Interruptable Callback :", SCRIPT_PARAM_ONOFF, true);
		Param.Callback:addSubMenu("Immobile", "Immobile");
			Param.Callback.Immobile:addParam("Enable", "Enable Immobile Callback :", SCRIPT_PARAM_ONOFF, true);
		Param.Callback:addSubMenu("AntiGapCloser", "AntiGapCloser");
			Param.Callback.AntiGapCloser:addParam("Enable", "Enable AntiGapCloser Callback :", SCRIPT_PARAM_ONOFF, true);
	Param:addSubMenu("", "n3");
	Param:addSubMenu("Extra Settings", "Extra");

	Miscellaneous:addSubMenu("Replay Settings", "Rpl");
	Miscellaneous.Rpl:addParam("Enable", "Use auto OP.GG recording :", SCRIPT_PARAM_ONOFF, false);
	Miscellaneous.Rpl:addParam("n1", "", SCRIPT_PARAM_INFO, "");
	Miscellaneous.Rpl:addParam("Press", "Record this game : (Press this button) ", SCRIPT_PARAM_ONOFF, false);
	Miscellaneous.Rpl:setCallback("Press", function(Opgg)
		if Opgg then
			Miscellaneous.Rpl.Press = false;
			self:GetGameID()
		else
			Miscellaneous.Rpl.Press = false;
		end
	end);

	Miscellaneous:addSubMenu("Recall Settings", "Recall");
		Miscellaneous.Recall:addParam("Enable", "Use recall :", SCRIPT_PARAM_ONOFF, true);
		Miscellaneous.Recall:addParam("n1", "", SCRIPT_PARAM_INFO, "");
		Miscellaneous.Recall:addParam("print", "Print recall :", SCRIPT_PARAM_ONOFF, false);
		Miscellaneous.Recall:addParam("draw", "Draw recall :", SCRIPT_PARAM_ONOFF, true);

	Miscellaneous:addParam("TargetLock", "Use target lock (left click) :", SCRIPT_PARAM_ONOFF, false);
end
